import {makeAutoObservable} from "mobx";

export default class DeviceStore {
    constructor() {
        this._types = [
            {id: 1, name: 'Frig'},
            {id: 2, name: 'Smartphone'}
        ]
        this._brands = [
            {id: 1, name: 'Samsung'},
            {id: 2, name: 'Apple'}
        ]
        this._devices = [
            {id: 1, name: 'Apple', price: 25000, rating: 5, img: 'data:image/jpeg;base64,'},
            {id: 2, name: 'Apple', price: 25000, rating: 5, img: 'data:image/jpeg;base64,'},
            {id: 3, name: 'Apple', price: 25000, rating: 5, img: 'data:image/jpeg;base64,'},
            {id: 4, name: 'Apple', price: 25000, rating: 5, img: 'data:image/jpeg;base64,'},
            {id: 5, name: 'Apple', price: 25000, rating: 5, img: 'data:image/jpeg;base64,'},
        ]
        makeAutoObservable(this);
    }

    setTypes(types) {
        this._types = types
    }

    setBrands(brand) {
        this._brands = brand
    }

    setDevices(device) {
        this._devices = device
    }

    get types() {
        return this._types
    }

    get brands() {
        return this._brands
    }

    get devices() {
        return this._devices
    }
}